sys_variable_value.value:
(function execute(inputs, outputs) {

    try {
        //remove whitespace from input strings
        inputs = new JenkinsUtils().trimStringInputs(inputs);

        if (inputs.build_range === '' || inputs.job_path === '') {
            new JenkinsUtils().throwError('get_build_history');
        }

        //Replace '-' or '..' with ',' in build range.
        if (inputs.build_range.contains("-")) {
            inputs.build_range = inputs.build_range.replace("-", ",");
            outputs.build_range = inputs.build_range.toString();
        } else {
            outputs.build_range = inputs.build_range;
        }

        //Remove first and last slash, if present in job name
        inputs.job_path = inputs.job_path.replace(/^\/|\/$/g, '');
        var job_full_path = "";

        //If job has parent job as well then form a resource path with leading job for every job otherwise pass the job name as it is.
        if (inputs.job_path.contains("/")) {
            var parent_jobs = inputs.job_path.split('/');
            for (var i = 0; i < parent_jobs.length; i++) {
                job_full_path += "/job/" + parent_jobs[i];
            }
            outputs.job_path = job_full_path.toString();
        } else {
            outputs.job_path = "/job/" + inputs.job_path.toString();
        }
    } catch (err) {
        new JenkinsUtils().throwError('get_build_history');
    }

})(inputs, outputs);

